// Navigation.js
import React from 'react';
import './Navigation.css'; // Import CSS file for styling
import { Link, useNavigate } from 'react-router-dom';

function Navigation ({ onSurveyButtonClick }) {
    const navigate = useNavigate();


//   const scrollToSection = (sectionId) => {
//     const section = document.getElementById(sectionId);
//     if (section) {
//       section.scrollIntoView({ behavior: 'smooth' });
//     }
//   };

const handleSurveyButtonClick = () => {
    navigate('/club_matching_survey');
  };

  return (
    <nav className="navbar">
      <span className="navbar-title">SJSU Club Matching</span>
      <ul>
        <li><Link to="/">Dashboard</Link></li>
        <li><Link to="/club_registration">lub Registration</Link></li>
        <li><Link to="/user_registration">User Registration</Link></li>
        <li><button onClick={handleSurveyButtonClick}>Club Matching Survey</button></li>
      </ul>
    </nav>
  );
};

export default Navigation;
